script: |
  super -f text -I q9951.spq | sort > q9951.out

inputs:
  - name: q9951.spq
    data: |
      SELECT DISTINCT + cor1.col1 * + cor1.col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q9951.out
    data: |
      1343
      217
      4602
